import bodyParser from 'body-parser';
import userRouter from './routers/userRouter';
import orderRouter from './routers/orderRouter';

const app = express();

app.use(cors());
app.use(bodyParser.json());
app.get('/api/products', (req, res) => {
  res.send(data.products);
});

